"Ketentuan Penggunaan MotionPay melalui Jamsostek Mobile (JMO)

Dengan menyetujui ketentuan ini serta dengan menggunakan fitur MotionPay melalui aplikasi Jamsostek Mobile (JMO), maka pengguna terikat dengan Ketentuan ini. MotionPay adalah produk uang elektronik untuk melakukan transaksi non tunai, dimana untuk layanan MotionPay dapat pengguna gunakan sebagai suatu fitur di aplikasi Jamsostek Mobile (JMO).

Dengan menyetujui Ketentuan ini, pengguna dianggap memahami bahwa : 

1. Dengan memperhatikan ketentuan Kebijakan Privasi BPJS Ketenagakerjaan yang berlaku terhadap pengguna aplikasi Jamsostek Mobile (JMO), Pengguna menyetujui dan memberikan kuasa kepada BPJS Ketenagakerjaan dalam hal ini melalui aplikasi Jamsostek Mobile (JMO) untuk menyimpan serta meneruskan data dan/atau informasi pengguna, yaitu Alamat Email dan Nomor Handphone, yang terdaftar pada akun Jamsostek Mobile (JMO) yang selanjutnya akan diteruskan BPJS Ketenagakerjaan ke MotionPay untuk keperluan pengguna menikmati layanan MotionPay; 

2. BPJS Ketenagakerjaan hanya menyimpan data dan/atau informasi yang pengguna isikan pada aplikasi Jamsostek Mobile (JMO) untuk digunakan pada fitur MotionPay. BPJS Ketenagakerjaan tidak menyimpan aktivitas yang dilakukan dari penggunaan fitur MotionPay; 

3. Proses, pengolahan, dan/atau penyimpanan data dan/atau informasi yang terkait dengan akun MotionPay akan dilakukan dan menjadi tanggung jawab MotionPay sepenuhnya; dan 

4. Segala aktivitas dan/atau hasil atas proses, pengolahan dan/atau penyimpanan data dan/atau informasi yang pengguna berikan kepada MotionPay melalui fitur MotionPay di aplikasi Jamsostek Mobile (JMO), akan tunduk kepada Syarat dan Ketentuan dan Kebijakan Privasi yang dikeluarkan MotionPay; 

Oleh karena itu, pengguna dengan ini membebaskan BPJS Ketenagakerjaan dari segala tuntutan, kerugian, akibat, dan pertanggungjawaban dalam bentuk apapun yang timbul atas pemprosesan, pengolahan, dan/atau penyimpanan yang dilakukan oleh MotionPay atas data dan/atau infomasi yang pengguna berikan kepada MotionPay melalui fitur MotionPay di aplikasi Jamsostek Mobile (JMO). 

Pengguna dapat mengajukan pertanyaan dan/atau keluhan terkait fitur MotionPay di aplikasi Jamsostek Mobile (JMO). Pengguna dapat menghubungi layanan informasi MotionPay ke Customer Service MotionPay (021) 1500 899 (ext.4), atau Email : cs@motionpay.id, atau Whatsapp : +62 852 8408 0700"
